    [],nt"revision_timestamp": "2016-07-19T05:40:30.058797",nt"name": "immune-epitope-database-and-analysis-resource-iedb",nt"isopen":
    true,nt"url": null,nt"notes": "<p>This repository contains antibody/B cell
    and T cell epitope information and epitope prediction and analysis tools for use
    by the research community worldwide. Immune epitopes are defined as molecular structures
    recognized by specific antigen receptors of the immune system, namely antibodies,
    B cell receptors, and T cell receptors. Immune epitopes from infectious diseases,
    excluding HIV, and immune-mediated diseases and the accompanying biological information
    are included.</p>n",nt"license_title": "Other License Specified",nt"extras":
